  \"2015-09-26T19:26:23.016794\",\n\t\"name\": \"the-dehn-collection-of-arctic-sea-ice-charts-1953-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"nThe National Snow and Ice Data Center
  holds a collection of charts depicting ice conditions in the seas off Alaska and
  western Canada coasts.   Ice edge position and some ice concentration and other
  information are included, though the notations on the charts are often sparse and
  discontinuous in space and time, especially for older charts in the series.   These
  charts, more that 6,800 in number, were donated to NSIDC by the estate of  William
  H. Dehn.  NSIDC has partnered with the NOAA Climate Database Modernization Program
  (CDMP) and the National Geophysical Data Center (NGDC) to scan the charts and to
  make them available through a searchable interface.n\",\n\t\"license_title\": null,\n\t\"extras\":
